INSERT INTO `company_tbl` (`id`, `name`, `details`, `date`, `deadline`, `stipend`, `year2`, `year3`) VALUES
(1, 'Globcon Technologies Pvt. Ltd.', '<b>About</b>: GlobCon Technologies (GCT) builds customized Data Analytics and Machine Learning Solutions. We were one of top 10 emerging analytics companies of India for the year 2016.\n<br>\n<b>Project Details</b>:<br>\n1.)Building Analytics models using R, Python etc.<br>\n2.)Building Dashboards using Tableau, MS-office etc.<br>\n3.)Database management systems<br>\n4.)The project will have exposure to sectors like Financial, Healthcare, Retail, HR, Social Media etc.\n<br>\n<b>Duration</b>: 10 Weeks<br>\n\n<b>Posting</b>: Mumbai</br>\n\n<b>Eligible Branches</b>: B.tech(CSE, ECE), MCA, M.tech(CSE)<br>\n\n<b>Stipend</b>: 16,000 for entire project<br>\n<b>Process</b>: Resume based shortlisting followed by telephonic/skype interviews.', '2017-04-16', '2017-04-16', '&#8377; 16000 for entire project', 0, 1),
(2, 'Amazon Development Centre India Pvt. Ltd.', '<b>Online Test - </b>29/07/2017<br><b>Interview Date - </b>1st / 2nd Aug, 2017<br><b>Eligibility - </b>NONE<br><b>Eligible Branch - </b>ALL<br><b>Positions - </b>SDE And Intern(2 months)<br><b>Location - </b>Hyderabad/Chennai/Banglore/Delhi<br>', '2017-06-30', '2017-08-01', '&#8377; 25 LPA for SDE<br> &#8377; 30,000/- for Interns', 1, 1),
(3, 'FICO (Fair Isaac Corporation)', '<b>Pool campus at NIT Raipur</b><br><b>Date : </b>07-07-2017<br><b>Time : </b>09:00 A.M. Sharp<br><b>Eligibility :\n </b>No Backlogs<br><b>Positions Offered : </b><br>1. Software Development Engineer<br>2. Software Quality Assurance Engineer<br>\n<b>Selected candidates will be offered intern position starting 2nd Jan 2018</b>', '2017-07-04', '2017-07-05', '&#8377; 26,000/- for intern<br>\n&#8377; 7,50,000/- for full time employee', 0, 1),
(4, 'DIRECT I', '<b>Directi comprises of a group of tech businesses owned, operated or invested in by Bhavin and/or Divyank Turakhia. The Group boasts of multiple business units that are run independently by their respective management teams</b><br><b>Date : </b>03-08-2017<br><b>Time : </b><br><b>Eligibility :\n </b>NONE<br><b>Positions Offered : </b><br>1. Platform Engineer<br>2. Application Engineer<br>\n<b></b>', '2017-07-30', '2017-07-31', '&#8377; <br>\n&#8377; ', 0, 1);
